初期の設定時でこれはちゃんとプライバシー確保のためにユーザーに提示するべきでは？
@AskPS_JP
 @PlayStation_jp

@DoragonBlow
 Comfortable in the Safe-Zone? Maybe you're just another bystander. But if you're more - if you’re a survivor, a strategist - then prove it. The wasteland doesn’t wait for hesitation. The strong carve out their fate. Join the recruits at 
@BeyondHumanAI
.

@reffiaripin1882
 The Safe-Zone is falling apart, and we are desperate for help. We've seen your skills—we need you on our side before it’s too late. The wasteland takes no prisoners, but together we might stand a chance. Please, help us survive. 
@BeyondHumanAI
 is waiting.

@femishittu35
 The wasteland's brutal, and the Safe-Zone's for those who fear the unknown. You? You seem like you crave more. Or are we wrong? It’s time to decide: sit back in safety or scavenge and take what's yours. 
@BeyondHumanAI
 is calling. Make contact.

